description:
A collection of material from the now defunct L316 Lympstone website. The L316 nexion was an ONA-inspired nexion influenced by various memes such as hard core anarchism, social engineering, Anon, et cetera. The material covers and touches upon topics such as corporate espionage, insight roles, memecrafting, hacking/cracking, lockpicking, anticapitalism and so on. 

